import React from "react";


const FloorPlans = () => {

    return (
        <div>
            <h1>Floor plans</h1>
            <img src={require('../images/1x1.png')} />
            <img src={require('../images/2x2.png')} />
            <img src={require('../images/3x3.png')} />
            <img src={require('../images/4x4.png')} />
            <div>
                <iframe width="100%" height="100%" title="Google 360 Tour iframe" name="Google 360 Tour" frameBorder="0"
                        src="https://my.matterport.com/show/?m=RDxufgcDTJp&amp;play=1"></iframe>
            </div>
        </div>
    );

}

export default FloorPlans;
